import { Row, Alert, Accordion } from "react-bootstrap";
import AccordionBody from "react-bootstrap/esm/AccordionBody";

const Negocios = ({ negocios }) => {
  return (
    <Row className="negocios">
      <Accordion defaultActiveKey="0">
        {negocios.map((negocio) => {
          return (
            <Accordion.Item eventKey="0">
              <Accordion.Header>Negocio</Accordion.Header>

              <Accordion.Body>
                <p>
                  Mercado Negociado: <b>{negocio["Negociação"]}</b>
                </p>
                <p>
                  Compra ou venda: <b>{negocio["C/V"]}</b>
                </p>
                <p>
                  Categoria do ativo: <b>{negocio["Tipo de mercado"]}</b>
                </p>
                <p>
                  Nome do ativo:{" "}
                  <b className="verde">{negocio["Nome Pregão"]}</b>
                </p>
                <p>
                  Código do ativo: <b>{negocio["Código"]}</b>
                </p>
                <p>
                  Quantidade: <b>{negocio["Quantidade"]}</b>
                </p>
                <p>
                  Valor unitário:{" "}
                  <b>
                    R$
                    {negocio["Preço"].toLocaleString("pt-br", {
                      minimumFractionDigits: 2,
                    })}
                  </b>
                </p>
                <p>
                  Valor total:{" "}
                  <b>
                    R$
                    {negocio["Valor Operação"].toLocaleString("pt-br", {
                      minimumFractionDigits: 2,
                    })}
                  </b>
                </p>
                <p>
                  Coberto/Descoberto: <b>{negocio["D/C"]}</b>
                </p>
              </Accordion.Body>
            </Accordion.Item>
          );
        })}
      </Accordion>
    </Row>
  );
};

export default Negocios;
